import { Card, Carousel } from 'react-bootstrap';
import "./CustomCardImg.css";

function CustomCardImg({title='', year='', duration='', images=[]}) {

    return (
        <Carousel>
          {images.map((image, index) => (
            <Carousel.Item key={index}>
              <img className="img-fluid" src={image} alt="Primer slide" />
              <Carousel.Caption style={{ height: '2em' }}>
                <div style={{ backgroundColor: 'rgba(0, 0, 0, 0.7)' }}>
                    <h4 className="carousel-title">{title} <small>({year})</small></h4>
                    <p className="carousel-description"><small>{duration}</small></p>
                </div>
              </Carousel.Caption>
            </Carousel.Item>
          ))}
        </Carousel>
    );
      
}

export default CustomCardImg;
